import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import './SponsorsSection.css';

const SponsorsSection = () => {
  const [ref, inView] = useInView({
    threshold: 0.2,
    triggerOnce: true
  });

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        delayChildren: 0.3,
        staggerChildren: 0.2
      }
    }
  };

  const itemVariants = {
    hidden: { y: 30, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1,
      transition: {
        duration: 0.8,
        ease: "easeOut"
      }
    }
  };

  const logoVariants = {
    hidden: { scale: 0.8, opacity: 0 },
    visible: {
      scale: 1,
      opacity: 1,
      transition: {
        duration: 0.6,
        ease: "easeOut"
      }
    }
  };

  // Placeholder sponsors - you can replace with actual sponsor data
  const sponsors = {
    platinum: [
      { name: "TechCorp", logo: "üè¢" },
      { name: "InnovateLab", logo: "üöÄ" }
    ],
    gold: [
      { name: "DevStudio", logo: "üíª" },
      { name: "StartupHub", logo: "‚≠ê" },
      { name: "CodeForge", logo: "‚ö°" }
    ],
    silver: [
      { name: "TechStart", logo: "üîß" },
      { name: "Digital Solutions", logo: "üì±" },
      { name: "Innovation Center", logo: "üí°" },
      { name: "Future Tech", logo: "üåü" }
    ]
  };

  return (
    <section className="sponsors-section section" id="sponsors">
      <div className="container">
        <motion.div 
          ref={ref}
          className="sponsors-content"
          variants={containerVariants}
          initial="hidden"
          animate={inView ? "visible" : "hidden"}
        >
          <motion.h2 className="section-title" variants={itemVariants}>
            Our Amazing Sponsors
          </motion.h2>

          <motion.p className="sponsors-subtitle" variants={itemVariants}>
            Thank you to our partners who make this hackathon possible
          </motion.p>

          {/* Platinum Sponsors */}
          <motion.div className="sponsor-tier platinum-tier" variants={itemVariants}>
            <h3 className="tier-title">Platinum Partners</h3>
            <div className="sponsor-logos platinum-logos">
              {sponsors.platinum.map((sponsor, index) => (
                <motion.div 
                  key={index}
                  className="sponsor-card platinum-card"
                  variants={logoVariants}
                  whileHover={{ 
                    scale: 1.05,
                    y: -5,
                    transition: { duration: 0.3 }
                  }}
                >
                  <div className="sponsor-logo">{sponsor.logo}</div>
                  <div className="sponsor-name">{sponsor.name}</div>
                </motion.div>
              ))}
            </div>
          </motion.div>

          {/* Gold Sponsors */}
          <motion.div className="sponsor-tier gold-tier" variants={itemVariants}>
            <h3 className="tier-title">Gold Partners</h3>
            <div className="sponsor-logos gold-logos">
              {sponsors.gold.map((sponsor, index) => (
                <motion.div 
                  key={index}
                  className="sponsor-card gold-card"
                  variants={logoVariants}
                  whileHover={{ 
                    scale: 1.05,
                    y: -5,
                    transition: { duration: 0.3 }
                  }}
                >
                  <div className="sponsor-logo">{sponsor.logo}</div>
                  <div className="sponsor-name">{sponsor.name}</div>
                </motion.div>
              ))}
            </div>
          </motion.div>

          {/* Silver Sponsors */}
          <motion.div className="sponsor-tier silver-tier" variants={itemVariants}>
            <h3 className="tier-title">Silver Partners</h3>
            <div className="sponsor-logos silver-logos">
              {sponsors.silver.map((sponsor, index) => (
                <motion.div 
                  key={index}
                  className="sponsor-card silver-card"
                  variants={logoVariants}
                  whileHover={{ 
                    scale: 1.05,
                    y: -5,
                    transition: { duration: 0.3 }
                  }}
                >
                  <div className="sponsor-logo">{sponsor.logo}</div>
                  <div className="sponsor-name">{sponsor.name}</div>
                </motion.div>
              ))}
            </div>
          </motion.div>

          {/* Become a Sponsor CTA */}
          <motion.div className="sponsor-cta" variants={itemVariants}>
            <div className="cta-card">
              <div className="cta-icon">ü§ù</div>
              <div className="cta-content">
                <h3>Become a Sponsor</h3>
                <p>Join us in supporting innovation and social impact. Partner with us to make a difference!</p>
                <a href="mailto:sponsors@tira.edu" className="cta-button">
                  Partner With Us
                </a>
              </div>
            </div>
          </motion.div>
        </motion.div>
      </div>
    </section>
  );
};

export default SponsorsSection;
